import React from 'react';
import './ooter.css';
// Import social media icons here, e.g., from FontAwesome or any other library

const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer-content">
                <div className="footer-section company-info">
                    <h1>montaye</h1>
                    <p>Travel is freedom | Leading Adventure Tour Company</p>
                    <div className="social-media">
                        <p>Follow us on</p>
                        {/* Insert social media icons here */}
                    </div>
                    <ul className="links-list">
                        <li>Cancellation Policy</li>
                        <li>Refund Policy</li>
                        <li>Privacy Policy</li>
                        <li>Terms & Conditions</li>
                    </ul>
                </div>
                <div className="footer-section contact-info">
                    <h2>Montaye Headquarters</h2>
                    <p>205E, New Ashok Nagar, Delhi-96,</p>
                    <p>Uttarakhand 263001</p>
                    <h2>Regional Office</h2>
                    <p>34/2C, Shivaji Road, Dehradun, Uttarakhand</p>
                </div>
            </div>
            <div className="footer-bottom">
                <p>Upcoming Trips & Treks</p>
                {/* Add mountain silhouette here if needed */}
            </div>
        </footer>
    );
};

export default Footer;
